import React from "react";

const Header = props => {
  let time = `${Math.floor(props.timer)}s`;

  return (
    <div className="board-head">
      <div className="flag-count">{props.flagCount}</div>
      <div className="reset">
        <button className="reset-btn">Reset</button>
      </div>
    </div>
  );
};

export default Header;
